import React from "react"
import HeaderTiles from "./HeaderTiles"
import "../assets/css/header.css"

class Header extends React.Component{
    render(){
        return (
            <div className="header">
                <HeaderTiles />
                <HeaderTiles />
                <HeaderTiles />
                <HeaderTiles />
                <HeaderTiles />
            </div>
        )
    }
}

export default Header
